export default function ItemList({
  category,
  notebookProduct,
  desktopProduct,
}) {
  return (
    <>
      {category === "notebook" ? (
        notebookProduct.map(function (item) {
          return (
            <div>
              <h1>{item.id}</h1>
            </div>
          )
        })
      ) : (
        desktopProduct.map(function(item){
            return(
                <div>
              <h1>{item.id}</h1>
            </div>
            )
        })
      )}
    </>
  );
}
